from collections import Counter

class Solution:
    def totalFruit(self, fruits):

        # if len(set(fruits))<3:
        #     return len(fruits)

        # result = 0
        # temp = []
        # uniques = 0

        # for swi in range(len(fruits)):
        #     temp = []
        #     uniques = 0
        #     for swj in range(swi, len(fruits)):
        #         # print(f'swi: {fruits[swi]} swj: {fruits[swj]} temp: {temp} uniques: {uniques}')
        #         if fruits[swj] not in temp and uniques < 2:
        #             temp.append(fruits[swj])
        #             uniques += 1
        #             result = max(result, len(temp))
        #         elif fruits[swj] in temp:
        #             temp.append(fruits[swj])
        #             result = max(result, len(temp))
        #         elif fruits[swj] not in temp and uniques >= 2:
        #             break
        
        # return result


        baskets = Counter()
        left = right = max_num = 0
        
        while right < len(fruits):
            baskets[fruits[right]] += 1
            right += 1
            
            while len(baskets) == 3:
                baskets[fruits[left]] -= 1
                if baskets[fruits[left]] == 0:
                    del baskets[fruits[left]]
                left += 1
                
            max_num = max(max_num, right - left)
        return max_num

